function Greet() {
var n = document.getElementById('name').innerHTML;
return(console.log("Hello" +n))

}
const Login = () => {
    return (
        <>
            <h1>This is loggin page.</h1>
            <input type='text' id='name' />
            <input type='text' id='number' />
            <button onClick={Greet}>Submit</button>
        </>
    )
}

export default Login;
